var UiObjectBase = require("./ui_object_base.js");
var UiObjectBaseTO = UiObjectBase.UiObjectBaseTO;
var UiObjectBaseDescription = UiObjectBase.UiObjectBaseDescription;

/**
 * The description of a UIAPro tree view item test object.
 * @param {Object} [props] Initializes a UIAPro TreeViewItem test object using the supplied property bag.
 * @returns {TreeViewItem} the description object that was initialized.
 * @class TreeViewItem
 * @extends UIAPro.UiObjectBaseDescription
 * @memberof UIAPro
 */
function TreeViewItem(props) {
    var treeViewItemDesc = new UiObjectBaseDescription("TreeViewItem");

    treeViewItemDesc._defineByPropertyBag(props);
    return treeViewItemDesc;
}

/**
 * A UIAPro tree view item.
 * @constructor
 * @class TreeViewItemTO
 * @extends UIAPro.UiObjectBaseTO
 * @memberof UIAPro
 */
function TreeViewItemTO(session, description) {
    description = description || TreeViewItem();
    var treeViewItemTO = new UiObjectBaseTO("UIAProTreeItem", session, description);

    return treeViewItemTO;
}

module.exports.TreeViewItemTO = TreeViewItemTO;
module.exports.TreeViewItem = TreeViewItem;